import React, { useState, useRef, Suspense } from 'react'
import { Canvas, useFrame } from '@react-three/fiber'
import { Physics, RigidBody, CuboidCollider } from '@react-three/rapier'
import { OrbitControls, Environment, Sky, Grid, Splat } from '@react-three/drei'
import { GoogleGenerativeAI } from "@google/generative-ai"
import { Buffer } from 'buffer';
window.Buffer = window.Buffer || Buffer;

const API_KEY = "AIzaSyCYUzL_y8r-AUuSPiSbBahgmxclZd3pqNQ"
const genAI = new GoogleGenerativeAI(API_KEY)

const PHYSICS_PROPS = {
  bookshelf: { size: [1.2, 4, 0.6], mass: 25, color: '#5d4037', hazardMsg: "High Tipping Risk" },
  refrigerator: { size: [1.6, 3, 1.6], mass: 150, color: '#bdc3c7', hazardMsg: "Crush Hazard" },
  chair: { size: [0.8, 1, 0.8], mass: 10, color: '#2c3e50', hazardMsg: "Sliding Hazard" },
  table: { size: [3, 1, 2], mass: 45, color: '#8B4513', hazardMsg: "Stable" }
}

function Room({ magnitude }) {
  const rigidBody = useRef()
  useFrame(({ clock }) => {
    if (rigidBody.current && magnitude > 0) {
      const t = clock.getElapsedTime()
      const intensity = Math.pow(magnitude / 9, 3)
      const freq = 12 + magnitude * 2
      const amp = intensity * 0.2
      rigidBody.current.setNextKinematicTranslation({ 
        x: Math.sin(t * freq) * amp, y: 0, z: Math.cos(t * freq * 1.1) * amp 
      })
    }
  })
  return (
    <RigidBody ref={rigidBody} type="kinematicPosition">
      <CuboidCollider args={[20, 0.1, 20]} friction={4} />
      <Grid infiniteGrid sectionColor="#333" cellColor="#111" />
    </RigidBody>
  )
}

export default function App() {
  const [magnitude, setMagnitude] = useState(0)
  const [splatUrl, setSplatUrl] = useState(null) // URL to the COLMAP/Splat file
  const [detectedObjects, setDetectedObjects] = useState([])
  const [loading, setLoading] = useState(false)

  // 1. SIMULATE VIDEO PROCESSING
  const handleVideoUpload = async (e) => {
    setLoading(true)
    // In a real app, you'd upload to a server running COLMAP
    // For now, we simulate the result of that process:
    setTimeout(() => {
      // Use a sample .splat file to test
      setSplatUrl("")
      setDetectedObjects([
        { type: 'refrigerator', x: 2, z: -3 },
        { type: 'table', x: -2, z: -1 },
        { type: 'chair', x: 0, z: 2 }
      ])
      setLoading(false)
    }, 3000)
  }

  return (
    <div style={{ width: '100vw', height: '100vh', background: '#000' }}>
      <div style={{ position: 'absolute', zIndex: 10, padding: '25px', color: 'white', background: 'rgba(0,0,0,0.8)', width: '350px' }}>
        <h2>QUAKEPROOF AI v3</h2>
        <p style={{fontSize: '11px'}}>Upload Room Video (COLMAP Reconstruction)</p>
        <input type="file" accept="video/*" onChange={handleVideoUpload} />

        {loading && <p>Running COLMAP & SLAM Reconstruction...</p>}

        {splatUrl && (
          <div style={{marginTop: '20px'}}>
            <label>Magnitude: {magnitude}</label>
            <input type="range" min="0" max="9" step="0.1" style={{width: '100%'}} value={magnitude} onChange={(e) => setMagnitude(parseFloat(e.target.value))} />
            <button onClick={() => setMagnitude(0)} style={{marginTop: '10px', width: '100%'}}>Reset Simulation</button>
          </div>
        )}
      </div>

      <Canvas camera={{ position: [0, 5, 10], fov: 45 }}>
        <Suspense fallback={null}>
          {/* THE RECONSTRUCTED ROOM (The "Visual" part) */}
          {splatUrl && <Splat src={splatUrl} position={[0, 0, 0]} rotation={[0, Math.PI, 0]} />}

          <Physics gravity={[0, -9.81, 0]}>
            <Room magnitude={magnitude} />

            {/* THE COLLIDERS (The "Physical" part) */}
            {detectedObjects.map((obj, i) => {
              const data = PHYSICS_PROPS[obj.type]
              return (
                <RigidBody key={i} position={[obj.x, 2, obj.z]} mass={data.mass}>
                  <mesh>
                    <boxGeometry args={data.size} />
                    <meshStandardMaterial color={data.color} transparent opacity={0.2} />
                  </mesh>
                </RigidBody>
              )
            })}
          </Physics>
        </Suspense>

        <OrbitControls />
        <Environment preset="city" />
      </Canvas>
    </div>
  )
}
